import React from 'react';

const PLAYERS = [
    {id: 'p1', name: 'acetone7', splayed: 3, swins: 0, mwins: 3 }, 
    {id: 'p2', name: 'dmytrozukas', splayed: 1, swins: 1, mwins: 6 },
    {id: 'p3', name: 'baby', splayed: 1, swins: 1, mwins: 1 }
];

export default PLAYERS;
